const DisplayData = (props) => {
    const displayEvents = () => {
        const listItems = props.data.map((item, idx) => 
            <li key={idx}>{item.summary}</li>
        );
        return (
            <ul>{listItems}</ul>
        )
    }

    return (
        <div>
            {displayEvents()}
        </div>
    );
}

export default DisplayData;
